import React, { Component } from "react";
import { Router, Route } from "react-router-dom";
import Home from "./Home/Home";
export default class Routes extends Component {
  render() {
    return (
      <div>
        <Router history={history}>
          <Route
            path="/"
            exact
            strict
            render={() => {
              return <Home />;
            }}
          />
        </Router>
      </div>
    );
  }
}
